export const setRabbits = (state) =>{
    return{
        type: 'SET_RABBITS',
        payload: state
    }
}

export const setFoxes = (state) =>{
    return{
        type: 'SET_FOXES',
        payload: state
    }
}

export const addPlants = (state) =>{
    return{
        type: 'ADD_PLANTS',
        payload: state
    }
}

export const setSpeed = (speed) =>{
    return{
        typeof:'SET_SPEED',
        payload: speed
    }
}
